if(undefined==params.color){params.color=wacss.color()}
let modal=document.createElement('div');modal.id='wacss_modal';let modal_close=document.createElement('span');modal.className='wacss_modal';if(undefined!=title&&title.length>0){let modal_title=document.createElement('div');modal_title.className='wacss_modal_title '+params.color;modal_close.className='wacss_modal_close icon-close';modal_close.title="Close";modal_close.onclick=function(){removeId(this.pnode)}
modal_title.appendChild(modal_close);let modal_title_text=document.createElement('div');modal_title_text.className='wacss_modal_title_text';modal_title_text.innerHTML=title;modal_title.appendChild(modal_title_text);modal.appendChild(modal_title)}
let modal_content=document.createElement('div');modal_content.className='wacss_modal_content';modal_content.innerHTML=htm;modal.appendChild(modal_content);if(undefined!=params.overlay){let modal_overlay=document.createElement('div');modal_overlay.id='wacss_modal_overlay';modal_overlay.className='wacss_modal_overlay '+params.color;modal_overlay.appendChild(modal);modal_close.pnode=modal_overlay;if(undefined!=params.overlay_close){modal_overlay.onclick=function(){let elements=document.querySelectorAll(':hover');let i=elements.length-1;if(this==elements[i]){removeId(this)}}}else{modal_overlay.onclick=function(){let elements=document.querySelectorAll(':hover');let i=elements.length-1;if(this==elements[i]){wacss.modalBlink()}}}
document.body.appendChild(modal_overlay)}else{modal_close.pnode=modal;document.body.appendChild(modal)}
